import React from 'react';

const ArticlePagination = (props) => {
  const changePage = () => {
    props.listArticles(props.number, props.elementsByPage);
  }
  return <button onClick={changePage}>{props.number} </button>
}

const mapStateToProps = (state) => {
  return {
    articles: state.articlesReducer.articles,
    pages : state.articlesReducer.pages,
    elementsByPage : state.articlesReducer.elementsByPage,
    currentPage : state.articlesReducer.currentPage
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    listArticles: (page, quantity_elements) => dispatch(allArticles(page, quantity_elements))
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(ArticlePagination);
